import logo from "./logo.svg";
import "./App.css";
import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: "a1",
      title: "Car Insurance",
      amount: 35000,
      date: new Date(2023, 8, 30),
    },
    {
      id: "a2",
      title: "Bajaj Pulsar NS 200",
      amount: 220000,
      date: new Date(2023, 8, 30),
    },
    {
      id: "a3",
      title: "3bhk Flat",
      amount: 8500000,
      date: new Date(2023, 8, 30),
    },
  ];
  return (
    <div>
      <h1>App Component</h1>
      <ExpenseItem expense={expense[0]}></ExpenseItem>
    </div>
  );
}

export default App;
